using namespace std;

class Solution {
private:
public:
	int edgeScore(vector<int>& edges) {
		map<int,long long> mp;
		int max_score = 0, res = 0;
   		const int N = edges.size();
		int count = 0;

		for (int src = 0; src < N; src++){
			int dest = edges[src];
			mp[dest] += (long long)src;
		}

		vector<int> most;
		for (map<int,long long>::iterator itr = mp.begin(); itr != mp.end(); itr++){
			int node = itr->first;
			long long score = itr->second;
			if (score > max_score){
				max_score = score;
				most.clear();
				most.push_back(node);
			} else if (score == max_score){
				most.push_back(node);
			}
		}
		return most[0];
    }
};

